import Card from "../Card/Card";
import style from './Cards.module.css';

export default function Cards(props) {
   const { characters, onClose } = props;
   return <div className={style.Cartas}>
      {characters.map((e) => (
          <Card 
          name={e.name}
          species={e.species}
          gender={e.gender} 
          image={e.image} 
          onClose={closeHandler}
          key={e.id}
          />
          ))}
   </div>;
}
